Text:
@dawnthief:

How the fuck do you think TV ratings are determined?  Siphoning unicorn farts down your cable line?

No, they're determined from people via surveys and set-top boxes in the Nielsen system, or feedback from places like hulu and TiVo, and they're then extrapolated to the general population based on demographics.  If you're not a Nielsen family or using one of these other reportable methods, watching or not watching doesn't fucking matter.
